task.summary:
day01
1. 能说出项目的基本概述;
2. 能说出股票相关的核心概念;
   2.1 股票、板块、大盘的概念;
   2.2 股票涨幅、涨跌、振幅、开盘、收盘、涨停|跌停概念;
3. 能说出项目的技术架构;
4. 能说出项目开发的基本流程;
5. 能够动手搭建开发环境;
   5.1 搭建后端开发环境;
   5.2 搭建前端环境;
6. 能够完成用户登录功能;

day02
1. 完善基于前后端分用户验证码登录功能;
2. 理解验证码生成流程,并使用postman测试;
3. 理解并实现国内大盘数据展示功能;
4. 理解并实现国内板块数据展示功能;
5. 理解后端接口调试和前后端联调的概念;

day03
1. 理解涨幅榜业务需求;
2. 理解涨停跌停概念，并涨停跌停基本实现;
3. 理解涨停跌停SQL分析流程，并根据接口文档自定义实现;
4. 理解echarts基本使用;
5. 掌握easyExcel基本使用,并实现涨幅榜数据导出功能;

day04
1.理解股票T和T-1概念，实现成交量对比功能;
2.理解个股涨跌幅度统计功能;
   2.1 分析业务，SQL落地;
   2.2 完善不存在数据的区间默认回显功能;
3.理解个股分时K线业务，并实现功能;
4.理解个股日K线业务，并实现功能;

day05
1.掌握RestTemplate基本使用;
2.阅读并理解第三方股票接口API;
3.基于RestTemplate实现国内大盘数据采集功能;
   3.1 项目集成RestTemplate;
   3.2 理解基于正则解析响应数据原理;
   3.3 掌握常用lambda集合流操作;
4.基于RestTemplate实现国内板块和股票流水数据采集功能;
5.熟悉mybatis批量插入实现;

